ฝากถึงอาจารย์ชัชชาตินะค่ะ
กทมปรับปรุงพื้นทางเท้า ร.พ จุฬาลงกรณ์ไปถึง รถไฟบีทีเอสราชดำริไม่มีไฟตลอดทางเดินมืดมากค่ะ คนเดินไม่เห็นทาง อันตรายมากค่ะ แต่ข้างตรงข้ามกับมีไฟตลอด

@Sirilapas_mfp #ก้าวไกล #ก้าวไกลบางกะปิ #ก้าวไกลกรุงเทพ หารือ

1. ไฟทางเดินริมทางแสนแสบโดนขโมยทำให้ทางมืด แก๊งจักรยานชมพูมาขโมยอีกแล้ว ทั้งที่ชาวบ้านจับตัวไปส่ง สน.หัวหมากมาแล้ว
2. ป้ายรถเมล์ไม่มีไฟ ไม่มีเลขบอก ทำให้รถเมล์ไม่จอดตามป้าย ปชช.ต้องเสี่ยงอันตรายในที่มืด (ป้ายราม77,…

พระราม 4-แยกพระโขนง น้ำท่วมหลายจุดเสมอฟุตบาท บางจุดครึ่งหน้าแข้ง ประชาชนคนไหนสัญจรไปมาโปรดระวัง

และอย่าขับรถฝ่าน้ำเร็วนะคะ นอกจากน้ำกระแทกใต้รถผู้อื่นแรงมากแล้ว คลื่นยังกระแทกบ้านคนแถวนั้นด้วยค่ะ แหะๆ

